(()=>{var d=()=>{document.addEventListener("DOMContentLoaded",()=>{let p=document.querySelector(".js-more"),n=document.querySelector("#app"),c=0;fetch("https://jsonplaceholder.typicode.com/posts").then(e=>e.json()).then(e=>{console.log(e),e.forEach(t=>{if(t.id<=10){let o=document.createElement("article");o.innerHTML=`<h2 class="card__title">${t.title}</h2>
                                  <p class="card__body">${t.body}</p>`,n.append(o)}})}),p.addEventListener("click",()=>{c+=1,fetch("https://jsonplaceholder.typicode.com/posts").then(e=>e.json()).then(e=>{console.log(e),e.forEach(t=>{if(t.id>10*c&&t.id<=10*(c+1)){let o=document.createElement("article");o.innerHTML=`<h2 class="card__title">${t.title}</h2>
                                  <p class="card__body">${t.body}</p>`,n.append(o)}})})})})};d();})();
